import styled from 'styled-components'

const StyledCard = styled.div`
   height: 400px;
    width: 500px;
    background: #16697a;
    border: 3px solid #333;
    text-align: center;
    border-radius: 50px;
    color: #ebebd3
`

const Card = (props) => {
  return (
    <StyledCard className="Card">
      {props.children}
    </StyledCard >
  )
}

export default Card
